"use strict";(self.webpackChunkdocusaurus_public_api=self.webpackChunkdocusaurus_public_api||[]).push([[840],{2828:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"obtener-documentos-relacionados","metadata":{"permalink":"/docusaurus-public-api/use-cases/obtener-documentos-relacionados","source":"@site/use-cases/2023-01-01-Documento-Relacionado.md","title":"\xbfC\xf3mo obtener documentos relacionados?","description":"Cuando se desea saber cu\xe1l es el documento relacionado a partir de la venta, por ejemplo saber si una boleta tiene asociado una pre-venta","date":"2023-01-01T00:00:00.000Z","formattedDate":"January 1, 2023","tags":[{"label":"documentos","permalink":"/docusaurus-public-api/use-cases/tags/documentos"}],"hasTruncateMarker":true,"authors":[{"name":"Hector Alvarado","title":"API/Integraciones","url":"https://www.bsale.cl/sheet/integraciones","imageURL":"https://i.imgur.com/U0LjsQz.png","key":"Hector"}],"frontMatter":{"slug":"obtener-documentos-relacionados","title":"\xbfC\xf3mo obtener documentos relacionados?","authors":"Hector","tags":["documentos"]},"nextItem":{"title":"\xbfC\xf3mo crear una Factura electr\xf3nica?","permalink":"/docusaurus-public-api/use-cases/como-crear-una-factura-api-bsale"}},"content":"Cuando se desea saber cu\xe1l es el documento relacionado a partir de la venta, por ejemplo saber si una boleta tiene asociado una pre-venta\\n\\n\x3c!--truncate--\x3e\\n\\nLo primero que se debe consultar, es por el detalle de la venta:\\n\\n```json title=\\"GET /v1/documents/2121/details.json\\"\\n        \\"variant\\": {\\n                        \\"href\\": \\"https://api.bsale.cl/v1/variants/4832.json\\",\\n                        \\"id\\": 4832,\\n                        \\"description\\": \\"SERVICIO MENSUAL ASESORIA MKT009\\",\\n                        \\"code\\": \\"16040661143915\\"\\n                    },\\n                    \\"note\\": \\"\\",\\n                    \\"relatedDetailId\\": 2833\\n                }\\n            ]\\n        }\\n```\\n\\nEn la respuesta obtendremos el identificador (relatedDetailId) del detalle que se us\xf3 en base a \xe9sta venta.\\n\\nSi consultamos el \\"detailid\\" como respuesta obtendremos el documento relacionado\\n\\n```json title=\\"GET /v1/documents.json?detailid=2833\\"\\n```\\n\\n:::info\\n- La referencia (relatedDetailId) se mostrar\xe1 siempre y cuando el documento por el cual estemos consultando constituya venta (Boleta, Factura).\\n- No se mostrara resultado cuando consultemos por el documento inicial que no constituya venta (del cual se genera la venta posterior, ejemplo: Nota de venta). \\nEn otras palabras: Podemos saber que documento esta relacionado a una Boleta. Mas, no podemos saber cual es el documento relacionado a una Nota de venta o Pedido Web. La consulta se debe hacer por el documento que constituye venta.\\n:::"},{"id":"como-crear-una-factura-api-bsale","metadata":{"permalink":"/docusaurus-public-api/use-cases/como-crear-una-factura-api-bsale","source":"@site/use-cases/2022-12-01-Factura-Electr\xf3nica.md","title":"\xbfC\xf3mo crear una Factura electr\xf3nica?","description":"This is the summary of a very long blog post,","date":"2022-12-01T00:00:00.000Z","formattedDate":"December 1, 2022","tags":[{"label":"ejemplo-json","permalink":"/docusaurus-public-api/use-cases/tags/ejemplo-json"},{"label":"documentos","permalink":"/docusaurus-public-api/use-cases/tags/documentos"},{"label":"cl","permalink":"/docusaurus-public-api/use-cases/tags/cl"}],"hasTruncateMarker":true,"authors":[{"name":"Esteban Bahamonde","title":"API/Integraciones","url":"https://www.bsale.cl/sheet/integraciones","imageURL":"https://i.imgur.com/FmDewBv.png","key":"Esteban"}],"frontMatter":{"slug":"como-crear-una-factura-api-bsale","title":"\xbfC\xf3mo crear una Factura electr\xf3nica?","authors":"Esteban","tags":["ejemplo-json","documentos","cl"]},"prevItem":{"title":"\xbfC\xf3mo obtener documentos relacionados?","permalink":"/docusaurus-public-api/use-cases/obtener-documentos-relacionados"},"nextItem":{"title":"Este es un ejemplo de caso de uso","permalink":"/docusaurus-public-api/use-cases/caso-de-uso-ejemplo"}},"content":"This is the summary of a very long blog post,\\n\\nUse a `\x3c!--` `truncate` `--\x3e` comment to limit blog post size in the list view.\\n\\n\x3c!--truncate--\x3e"},{"id":"caso-de-uso-ejemplo","metadata":{"permalink":"/docusaurus-public-api/use-cases/caso-de-uso-ejemplo","source":"@site/use-cases/2020-12-01-ejemplo.md","title":"Este es un ejemplo de caso de uso","description":"Todo caso de uso debe contener un enunciado, que deber\xe1 describir el caso planteado. Indicando el pa\xeds que afecta","date":"2020-12-01T00:00:00.000Z","formattedDate":"December 1, 2020","tags":[{"label":"documentos","permalink":"/docusaurus-public-api/use-cases/tags/documentos"},{"label":"stock","permalink":"/docusaurus-public-api/use-cases/tags/stock"},{"label":"CL","permalink":"/docusaurus-public-api/use-cases/tags/cl"},{"label":"PE","permalink":"/docusaurus-public-api/use-cases/tags/pe"},{"label":"MX","permalink":"/docusaurus-public-api/use-cases/tags/mx"}],"hasTruncateMarker":true,"authors":[{"name":"Hector Alvarado","title":"API/Integraciones","url":"https://www.bsale.cl/sheet/integraciones","imageURL":"https://i.imgur.com/U0LjsQz.png","key":"Hector"}],"frontMatter":{"slug":"caso-de-uso-ejemplo","title":"Este es un ejemplo de caso de uso","authors":["Hector"],"tags":["documentos","stock","CL","PE","MX"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":false,"draft":false,"unlisted":false},"prevItem":{"title":"\xbfC\xf3mo crear una Factura electr\xf3nica?","permalink":"/docusaurus-public-api/use-cases/como-crear-una-factura-api-bsale"}},"content":"Todo caso de uso debe contener un enunciado, que deber\xe1 describir el caso planteado. Indicando el pa\xeds que afecta\\n\\n\x3c!--truncate--\x3e\\n\\nSe deber\xe1 introducir al tema, describiendo el flujo, proceso u operaci\xf3n dentro de Bsale. \\n\\n## T\xedtulo Nivel 2 \\n\\n### T\xedtulo Nivel 3\\n\\n#### T\xedtulo Nivel 4\\n\\n## Hiperv\xednculos\\n[enlace]: Despacho  \\"opcional descr\\"\\n\\nThis is reference-style link. [enlace]\\n\\n## Im\xe1genes\\n![Example banner](https://www.imagestion.cl/images/logo_bsale.png)\\n\\n## Tablas\\nimport Tabs from \'@theme/Tabs\';\\nimport TabItem from \'@theme/TabItem\';\\n\\n<Tabs\\n  defaultValue=\\"apple\\"\\n  values={[\\n    {label: \'Apple\', value: \'apple\'},\\n    {label: \'Orange\', value: \'orange\'},\\n    {label: \'Banana\', value: \'banana\'},\\n  ]}>\\n  <TabItem value=\\"apple\\">This is an apple \ud83c\udf4e</TabItem>\\n  <TabItem value=\\"orange\\">This is an orange \ud83c\udf4a</TabItem>\\n  <TabItem value=\\"banana\\">This is a banana \ud83c\udf4c</TabItem>\\n</Tabs>\\n\\n## Bloques\\n:::note\\n\\nSome **content** with _Markdown_ `syntax`. Check [this `api`](#).\\n\\n:::\\n\\n:::tip\\n\\nSome **content** with _Markdown_ `syntax`. Check [this `api`](#).\\n\\n:::\\n\\n:::info\\n\\nSome **content** with _Markdown_ `syntax`. Check [this `api`](#).\\n\\n:::\\n\\n:::warning\\n\\nSome **content** with _Markdown_ `syntax`. Check [this `api`](#).\\n\\n:::\\n\\n\\n# Estructura GET\\n## GET Endpoint\\n- GET `/v1/documents.json` retorna todos los documentos.\\n\\n#### Ejemplos\\n- `GET /v1/documents.json?limit=50&offset=0`\\n- `GET /v1/documents.json?fields=[number,totalAmount]`\\n\\n\\n```json title=\\"Response Recurso.json \\"\\n            \\"guide\\": {\\n                \\"href\\": \\"https://api.bsale.cl/v1/documents/1510.json\\",\\n                \\"id\\": \\"1510\\",\\n                \\"number\\": 1,\\n                \\"urlPublicView\\": \\"https://app2.bsale.cl/view/8849/0ac5ee433f00?sfd=99\\",\\n                \\"urlPdf\\": \\"https://app2.bsale.cl/view/8849/0ac5ee433f00.pdf?sfd=99\\",\\n                \\"urlPublicViewOriginal\\": \\"https://app2.bsale.cl/view/8849/0ac5ee433f00\\",\\n                \\"urlPdfOriginal\\": \\"https://app2.bsale.cl/view/8849/0ac5ee433f00.pdf\\"\\n            }\\n```"}]}')}}]);